  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains counts, rates, and
  confidence intervals of 12 selected birth defects among live births during 2000-2006
  within eight California counties: Fresno, Kern, Kings, Madera, Merced, San Joaquin,
  Stanislaus, and Tulare. The data are aggregated into 5-year intervals. The data
  are stratified by county of residence, maternal age , maternal race/ethnicity and
  infant gender. The data are from an active surveillance system that ascertains birth
  defects among live births, fetal deaths, and terminations, using ICD-9 codes.\",\n\t\"license_title\":
